@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document url(http://www.google.com/),
               url-prefix(http://www.google.com/webhp),
               url-prefix(http://www.google.com/search?),
               url-prefix(http://www.google.com/#hl=),
               url-prefix(http://www.google.com/advanced_search),
               url-prefix(http://www.google.com/preferences),
               url-prefix(http://www.google.com/language_tools),
               url-prefix(http://images.google.com/webhp),
               url(http://www.google.com/intl/en/),
               url(http://www.google.com/intl/en/options/),         /*TODO*/
               url-prefix(http://www.google.com/movies),            /*TODO*/
               url-prefix(http://blogsearch.google.com),            /*TODO*/
               url-prefix(http://www.google.com/custom?)            /*TODO*/
{

/* Global Reset */

* {
text-decoration:none!important;outline:0!important;}
input, button, select, textarea, option {-moz-appearance:none!important;}

/* Style */

body {
background:#333 url(data:image/png;base64,) repeat-x fixed!important;
font-family:tahoma, sans-serif!important;
font-size:13px!important;}

a, .gb1, p#gb b {
color:#888!important;
font-weight:bold!important;
font-size:11px!important;}

a:hover, #guser, hr {color:#777!important;}

a:visited {color:#666!important;}

.gb2 {background:#222!important;border-bottom:1px solid #444!important;}

#gbi {border:1px solid #444!important;}

.gbd {border-top:1px solid #777!important;}

.gbh {border-top:none!important;}

body center:first-child img, center > img {
background:url(data:image/png;base64,) no-repeat!important;
padding-left:320px!important;
width:0!important;
margin:75px 0 0!important;}

#logo > img, #logo span, img[src$="logo_sm.gif"], img[src$="google_sm.gif"], img[src$="logo_google_suggest_sm.gif"] {
background:url(data:image/png;base64,) no-repeat!important;
padding-left:105px!important;
margin-top:24px!important;
width:0!important;}

input[title="Google Search"] {
background:url(data:image/png;base64,) no-repeat!important;
width:393px!important;
height:24px!important;
border:none!important;
padding:3px 6px!important;
color:#888!important;
margin:0 30px!important;}

input[name=btnG], input[value="Advanced Search"], input[value="Save Preferences "] {
background:url(data:image/png;base64,) no-repeat!important;
color:#888!important;
width:120px!important;
height:21px!important;
padding:0 0 3px 0!important;
border:none!important;
font-size:13px!important;}

input[name=btnG]:hover, input[value="Advanced Search"]:hover, input[value="Save Preferences "]:hover {
background:url(data:image/png;base64,) no-repeat!important;
cursor:pointer!important;}

input[size="41"] {
background:url(data:image/png;base64,) no-repeat!important;
border:none!important;
width:258px!important;
height:18px!important;
padding:1px 6px!important;
color:#888!important;}

div#ssb {
background:url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAAaCAIAAAGOYZEQAAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAAG5JREFUeNpicnJyZmJnZ2Pm5eVh+v7tB0AAMQUEBDB9eP+B6c2bNwABABgA5/8CU1NTAvj5+QL5+fgC9/j3AvPx8wL7/PwCNBwHNwDAMAgDJWbM/lu0n4BbXj5rZgSukddKLLu/W0f3nhYFRP/BB9RAPo/KMS4KAAAAAElFTkSuQmCC) repeat-x!important;
border:none!important;
color:#888!important;}

div#tbd {
background:#222!important;
border:1px solid #666!important;
color:#83986a!important;
opacity:.9!important;}

h3.r a {color:#d3d3d3!important;font-size:.8em!important;text-transform:uppercase!important;}
h3.r a:hover {color:#efefef!important;font-size:.8em!important;}
h3.r a:visited {color:#666!important;}

div.s, span.std b, li.g, .med b {color:#999!important;}

.med p {color:#83986a!important;}

div.med li {color:#bba138!important;}

div font[color="#666666"], div font[color="#666666"] br {color:#bba138!important;}

cite {color:#83986a!important;}

span.b, span.a {color:#bba138!important;font-weight:bold!important;}

.w10, .w11 {
background:url(data:image/png;base64,) no-repeat!important;}

.w20 {
background:url(data:image/png;base64,) no-repeat!important;}

.w21 {
background:url(data:image/png;base64,) no-repeat!important;}

.wci {
background:url(data:image/png;base64,) no-repeat!important;}

button[style="border: 0pt none ; padding: 0pt; background: transparent url(/images/sw2.png) no-repeat scroll -76px 0pt; -moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial; vertical-align: 27%; cursor: default; height: 12px; width: 12px;"] {
background:url(data:image/png;base64,) no-repeat!important;}

button[style="border: 0pt none ; padding: 0px; background: transparent url(/images/sw2.png) no-repeat scroll -64px 0pt; -moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial; vertical-align: 27%; cursor: default; height: 12px; width: 12px;"] {
background:url(data:image/png;base64,) no-repeat!important;}

.wce textarea, input#nqsbq, input[name="btnGNS"] {
background:#111!important;
border:1px solid #555!important;
color:#888!important;
padding:3px!important;}

input[name="btnGNS"]:hover {background:#333!important;cursor:pointer!important;}

input[value="Make a public comment"], input[value="Cancel"] {
background:#222!important;
border:1px solid #555!important;
color:#888!important;}

span.wct, font[color="#cc0000"], span.med, span.std {color:#bba138!important;}

span.std b {color:#999!important;}
 
#nav > tbody > tr > td span {background:none!important;}
#nav a {font-size:1.2em!important;color:#bababa!important;}
#nav a:hover {color:#a5a5a5!important;}
#nav a:visited {color:#626262!important;}
#nav .cur {font-size:1.2em!important;margin-top:-10px!important;color:#bba138!important;}
#nav td {vertical-align:bottom!important;padding:0.15em!important;}
span[style="color: rgb(169, 10, 8);"] {color:#bba138!important;}

#res .j {width:50em!important;}
#res {margin-left:1.2em!important;}

input[name=btnI],
font[size="-1"],
p font[size="-2"],
table#brs,
#bsf,
p a[href="/"],
p a[href="/intl/en/ads/"],
p a[href="/services/"],
p a[href="/intl/en/privacy.html"],
p a[href="/intl/en/about.html"],
div#wml,
.blk,
div.std {
display:none!important;}

table {color:#bababa!important;}
a#logo {font-size:0!important;}
p#ofr {color:#bba138!important;}
}

/* Advanced Search */
@-moz-document url-prefix(http://www.google.com/advanced_search) {

table[style="border-top: 1px solid rgb(51, 102, 204);"], .page-title, td[bgcolor="#d5ddf3"] {
background:#222!important;color:#555!important;border:1px solid #444!important;}

.page-title, td[bgcolor="#d5ddf3"] {border:none!important;}

h3, td.tip span {color:#656565!important;}

p.tip, #gen-query, #gen-query * {
background:#222!important;color:#777!important;text-transform:uppercase!important;font-weight:bold!important}

.comment {color:#999!important;}

.qbuilder-env, .block {border:1px solid #444!important;background:#222!important;}

.block {border-top:none!important;}

label {color:#5e6c4d!important;}

span {color:#888!important;}

input[name="as_q"],
input[name="as_epq"],
input[id="as_oq0"],
input[id="as_oq1"],
input[id="as_oq2"],
input[name="as_eq"],
select,
option,
input[name="as_sitesearch"],
input[name="as_nlo"],
input[name="as_nhi"],
input[type="radio"],
input[name="as_rq"],
input[name="as_lq"] {
background:#181818!important;color:#888!important;border:1px solid #444!important;padding:1px!important;}
option {border-top:none!important;padding-left:10px!important;}
input[name=btnG] {margin-left:10px!important;}
font[color="red"] {color:#bba138!important;}
}

/* Search Preferences */
@-moz-document url-prefix(http://www.google.com/preferences) {

font[size="-1"] {display:inherit!important;color:#999!important;}
td[bgcolor="#cbdced"] {background:#555!important;}
td[bgcolor="#e5ecf9"] {background:#222!important;border:1px solid #444!important;}
td[bgcolor="#e5ecf9"] {border-right:none!important;}
td[bgcolor="#e5ecf9"] {border-left:none!important;}
tr[bgcolor="#e5ecf9"] {background:#222!important;}
td[bgcolor="#3366cc"], iframe {display:none!important;}
font[color="#000000"] {color:#777!important;}
tr[bgcolor="#e5ecf9"] td, h1 {color:#83986a!important;}

select,option, input[type="radio"], input[type="checkbox"] {
background:#181818!important;color:#888!important;border:1px solid #444!important;}
option {border-top:none!important;padding-left:10px!important;}
}

/* Language Tools */
@-moz-document url-prefix(http://www.google.com/language_tools) {

td[bgcolor="#e5ecf9"],
h4,
tr[bgcolor="#ffffff"],
input[dir="ltr"],
select,
input[value="Translate and Search"], textarea, input[value="Translate"], input[value="http://"], input[size="40"] {
background:#222!important;border:1px solid #444!important;color:#999!important;}
textarea {padding:3px!important;}
input[value="Translate and Search"], input[value="Translate"] {background:#222!important;cursor:pointer!important;}
input[value="Translate and Search"]:hover, input[value="Translate"]:hover {background:#333!important;}
td[bgcolor="#e5ecf9"] {border-right:none!important;}
td[align="right"] {border-left:none!important;border-right:1px solid #444!important;}
font[size="-1"] {display:inherit!important;}
table[cellpadding="3"] {border:1px solid #444!important;}
}
